def in_contour(marker, coords_marker, districts):
    point = Point(coords_marker)
    col_error = 0
    for cont in contours:
        polygon = Polygon(cont)
        if polygon.contains(point) == True:
            ind = contours.index(cont)
            if ind == 5 or ind == 6:
                ind = 5
            if ind == 7 or ind == 8:
                ind = 6
            marker.add_to(districts[ind])
            col_error += 1
    if col_error == 0:
        ind = 7
        marker.add_to(districts[ind])




