def values_point(string):
    long = string.split('POINT(')[1].split(' ')[0]
    lat = string.split(' ')[1].split(')')[0]
    return [float(lat), float(long)]

def Reverse(tuples):
    new_tup = tuples[::-1]
    return new_tup


###Окраска контура дома в зависимости от цены
def color_area_home(coords_marker, coords_contour):
    new_data = []
    for i in coords_contour:
        elem = []
        elem += [i[0], i[1]]
        new_data.append(elem)
    return 0

def approximation(left_lower, right_upper, df):
    df = df[(df['lat']<=right_upper['lat']) & (df['lat']>=left_lower['lat'])]
    df = df[(df['long']<=right_upper['lng']) & (df['long']>=left_lower['lng'])]
    return df



def sort_info(df):
    adv_col_room = set(df['adv_rooms'].values)
    flats_by_rooms = {}
    for i in adv_col_room:
        _df = df[df['adv_rooms']==i]
        adv_advert_group = list(set(_df['adv_advert_group'].values))
        vect = []
        for id in adv_advert_group:
            df_adv = _df[_df['adv_advert_group'] == id]
            temp_d={}
            last_time_price = ar.last_time(df_adv[['adv_created_at', 'adv_price']].values)
            temp_d['address']=df_adv['address'].iloc[0]
            temp_d['adv_created_at']=last_time_price[0]
            temp_d['adv_price']=last_time_price[1]
            temp_d['adv_area']=df_adv['adv_area'].iloc[0]
            temp_d['price_area']=temp_d['adv_price']/temp_d['adv_area']
            temp_d['adv_rooms']=df_adv['adv_rooms'].iloc[0]
            vect.append(temp_d)
        flats_by_rooms[str(i)] = vect
    return flats_by_rooms